import logo from './logo.svg';
import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Navigate } from "react-router-dom";

import NewUserFormatted from './NewUserFormatted'
import LoginComponent from './LoginComponent';

function App() {
  return (
    <div className="App">
      <Router>
        <nav>
          <ul>
            <li>
              <Link to="/">Login</Link>
            </li>
            <li>
              <Link to="/signup">Sign Up</Link>
            </li>
          </ul>
        </nav>


        {/* Define your routes */}
        <Routes>
          {/* Default route to redirect to LoginComponent */}
          <Route path="/" element={<LoginComponent />} ></Route>

          {/* Other defined routes */}
          <Route path="/signup" element={<NewUserFormatted />} ></Route>

          {/* Redirect any unknown route to LoginComponent */}
          <Route path="*" element={<Navigate to="/" />} ></Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
